import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

// COMPONENT
class App extends Component{
  constructor(){
    super();
    this.state={
      name: {firstname:'Ruben', lastname:'BRAU'},
      company: 'VCC'
    }
  }
  render (){
    return(
      //-----------------------------------
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p> My name is {this.state.name.firstname} 
            {this.state.name.lastname} and I work at {this.state.company}</p>
            <button onClick={()=>{
              this.setState(()=>{
                return{
                  name: {firstname: 'BLEH', lastname: 'BLUUH'}
                }
              })
            }}>Change Name</button>
          </header>
        </div>        
      //-----------------------------------
    );
  }
}

export default App
